/**
 * @param {number[][]} maze
 * @param {number[]} start
 * @param {number[]} destination
 * @return {number}
 */
var shortestDistance = function(maze, start, destination) {
    // since we want the shortest distance we can use BFS
    let mem = {}
    let queue = [[start, 0]];
    let shortest = -1;
    while(queue.length){
        let [position, distance] = queue.shift();

        if(position[0] === destination[0] && position[1] === destination[1]){
            shortest = distance;
            break;
        }
        
        let nextSteps = getNextSteps(maze, position, mem);

        nextSteps.forEach(ns => queue.push([ns[0], distance + ns[1]]));
    }
     
    return shortest;
};

/*
* return an array of possible next (positions)
*/

function getNextSteps(maze, p, mem){
    let nextPositions = [];
    
    // top, down, right, left
    let steps = [[-1,0], [1,0], [0,1], [0,-1]]

    steps.forEach(step => {
        let np = p
        let isValid = 0;
        let stepCount = 0;
        while(isValid === 0){
            let posCandidate = [np[0] + step[0], np[1] + step[1]]
            isValid = maze[posCandidate[0]] != null ? maze[posCandidate[0]][posCandidate[1]] : 1;
            if(isValid === 0){
                stepCount++;
                np = posCandidate;
            }
        }

        if(mem[`${np[0]}${np[1]}`] == null && np !== null && (np[0] !== p[0] || np[1] !== p[1])){
            mem[`${np[0]}${np[1]}`] = true;
            nextPositions.push([np, stepCount]);
        }
    })
    return nextPositions;
    
}

